script: |
  super -f text -I q2536.spq | sort > q2536.out

inputs:
  - name: q2536.spq
    data: |
      SELECT DISTINCT + col1 / - col2 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT col2 BETWEEN NULL AND NULL AND NOT col0 BETWEEN NULL AND + col1 * - + 84;
  - name: tab0

outputs:
  - name: q2536.out
    data: |
